import React from 'react';
import data from "../data";

function course(){
	const data = {
		courses:[
		{
			id: 1,
			stack: 'Frontend Development',
			languages: ['Html 5', 'Css 3', 'Bootstrap', 'Javascript', 'React JS']

		},
	]
}
	return(
	<div className="card row">
      <div className="card-cover row">
        <div className="card-details">
          <h2>{data.courses.stack}A</h2>
          <h3>Languages</h3>
          <ul>
            <li>HTML 5</li>
          </ul>
          <button>See Curriculum</button>
          <button>About Tutor</button>
        </div>
        <div className="card-description">
          <img src="./images/frontend.jpg"/>
          <div>
            <h2>Description</h2>
            <span></span>
            <h4>Duration:<span></span></h4>
            <h1>Fee</h1>
            <button>Enroll Now</button>
          </div>
        </div>
      </div>
    </div>

		)
}

export default course;
